import React from "react";
import { Menu } from "antd";
import "../../App.css"

function Navbar() {
	return (
		<div>

			<Menu className="Navbar"
				items={[
					{ label: 'Home' },
					{ label: 'Automaten Generieren' },
					{ label: 'RISC-V Befehle' },
					{ label: 'Pipeline Konflikte' },
					{ label: 'BDD Generator' },
					{ label: 'AIG Generator' },
					{ label: 'SAT Solver' },
					{ label: 'Kontakt' },
				]}>

			</Menu>
		</div>

	)
}

export default Navbar
